import Navbar from "react-bootstrap/Navbar";
import { Container, Button } from "react-bootstrap";
import OverlayTrigger from "react-bootstrap/OverlayTrigger";
import Tooltip from "react-bootstrap/Tooltip";
import { BsFillCaretUpSquareFill } from "react-icons/bs";
import "./footer.css";

function Footer() {
  return (
      <div>

    <OverlayTrigger key="left" placement="left" overlay={<Tooltip id={`tooltip-left`}>Return to Top</Tooltip>}>
    <Button className="back-up" ><BsFillCaretUpSquareFill onClick={(event) => window.open("https://github.com/foofx88", "_blank")} />
    </Button>
  </OverlayTrigger>
    <Navbar bg="light" expand={false}>
      <Container fluid>
        <span className="foot">Made with React JS and BootStrap</span>

      </Container>
    </Navbar>
    </div>
  );
}

export default Footer;
